import React from 'react';
import axios from 'axios'


export default class userService extends React.Component{
    state = {
        user: [],
    };

    componentDidMount(){
        axios.get("https://localhost:5001/user")
        .then(res => {
            console.log(res)
            this.setState({ user: res.data});
        })
    }
}
